statement:
select COUNT(DISTINCT f.`becif_no`) as `VALUE`, dim2.`strategy_id_pdl` as `STRATEGY_ID_PDL` 
from  `hive`.`test_db`.`tbl_d` AS `f` LEFT OUTER JOIN `hive`.`test_db`.`tbl_b` AS `dim3` ON (`f`.`trace_id` = `dim3`.`trace_id`) AND (`f`.`dt` = `dim3`.`dt`) LEFT OUTER JOIN `hive`.`test_db`.`tbl_e` AS `dim2` ON (`f`.`strategy_id_pdl` = `dim2`.`strategy_id_pdl`) AND (`f`.`dt` = `dim2`.`dt`)
where f.`DT` >= 20231007 and f.`DT` <= 20231105 
and (((dim2.`strategy_id_pdl` <> '' or dim2.`strategy_id_pdl` is not null) )) group by dim2.`strategy_id_pdl` LIMIT 51000;
